import { Component, OnInit } from '@angular/core';
import { Activities } from 'src/app/interfaces/actividades';
import {GamesService} from '../../services/games.service';
import { AuthService } from 'src/app/services/auth.service';
import { Usuarios } from 'src/app/interfaces/usuarios';

@Component({
  selector: 'app-navigation',
  templateUrl: './navigation.component.html',
  styleUrls: ['./navigation.component.css']
})
export class NavigationComponent {
  user: any = [];

  usuarios: Usuarios= {
    idUsuario: undefined,
    nombre : '',
    correo: '',
    contrasena : '' ,
    telefono : undefined,
    nombreRol  : ''
  }

  constructor(private gameService: GamesService, private authService: AuthService){}
  ngOnInit(): void {
    var datos:any =this.authService.getCurrentUser();
    this.usuarios = datos[0];
    console.log(this.usuarios);
  }
  
  

  editUser(id:string){
    console.log(id);
  }
  
}
<div>
    
  <div class="header-blue">
    
      <nav class="navbar navbar-dark navbar-expand-md navigation-clean-search">
        
          <div class="container"><a class="navbar-brand" routerLink="/gestion">ActiPro</a><button class="navbar-toggler" data-toggle="collapse" data-target="#navcol-1"><span class="sr-only">Toggle navigation</span><span class="navbar-toggler-icon"></span></button>
              <div class="collapse navbar-collapse"
                  id="navcol-1">
                  
                  <form class="form-inline mr-auto" target="_self" >
                      <div class="form-group"><label for="search-field"><i class="fa fa-search"></i></label><input class="form-control search-field" type="search" name="search" id="search-field"></div>
                  </form><span class="navbar-text"> <a routerLink="/hist-act" class="login">Historial Actividades</a></span><a class="btn btn-light action-button" routerLink="/user" role="button"  >{{usuarios.nombre}}</a></div>
          </div>
          
      </nav>
      
</div>
